import ther from '../assets/images/ther.png'
function Rating({temperature}){


    if(! temperature)
    return(

    <div style={{padding: 10, fontSize:'1.2rem', color:'black'}}>

        36.5 ℃
        <img src={ther.png}></img>
    </div>);
    temperature = parseFloat(temperature);
    if(temperature >= 36.5)
    return(
        <div style={{padding: 10, fontSize:'1.2rem', color:'green'}}>
            {/* {temperature} ℃ */}
            <img style={{maxWidth:'50'}}src={ther}></img>
        </div>);
    else{
        return( <div style={{padding: 10, fontSize:'1.2rem', color:'red'}}>
        {temperature} ℃
        <img src={ther.png}></img>
        </div>)
    }
}

export default Rating;
